import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import hero1 from "../images/hero1.jpg"; // 使用现有的背景图

const PartnershipSearch = () => {
  const navigate = useNavigate();
  const [searchParams, setSearchParams] = useState({
    location: "",
    orgType: "",
    partnershipGoal: "",
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setSearchParams((prev) => ({
      ...prev,
      [name]: value,
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // 处理搜索逻辑
    console.log("Search params:", searchParams);
  };

  return (
    <div className="min-h-screen relative">
      {/* 背景图片 */}
      <div className="absolute inset-0 z-0">
        <img
          src={hero1}
          alt="Background"
          className="w-full h-full object-cover"
          style={{
            filter: "brightness(0.7) saturate(0.8)",
          }}
        />
      </div>

      {/* 返回按钮 */}
      <button
        onClick={() => navigate(-1)}
        className="absolute top-8 left-8 z-20 text-white hover:text-gray-200 transition-colors duration-200"
      >
        <svg
          className="w-8 h-8"
          fill="none"
          stroke="currentColor"
          viewBox="0 0 24 24"
        >
          <path
            strokeLinecap="round"
            strokeLinejoin="round"
            strokeWidth="2"
            d="M10 19l-7-7m0 0l7-7m-7 7h18"
          />
        </svg>
      </button>

      {/* 主要内容 */}
      <div className="relative z-10 min-h-screen flex flex-col items-center justify-center px-4">
        <h1 className="text-5xl md:text-6xl font-light text-white mb-12 text-center tracking-wide">
          Let's Find Your Perfect Partner
        </h1>

        <div className="w-full max-w-4xl bg-white/90 backdrop-blur-md rounded-2xl shadow-xl p-8">
          <form onSubmit={handleSubmit} className="space-y-6">
            <div className="grid md:grid-cols-2 gap-6">
              {/* Location */}
              <div>
                <label className="block text-sm font-medium text-gray-700 mb-2">
                  Location
                </label>
                <input
                  type="text"
                  name="location"
                  value={searchParams.location}
                  onChange={handleChange}
                  className="w-full px-4 py-3 rounded-xl border border-gray-200 focus:ring-2 focus:ring-teal-500 focus:border-transparent transition duration-200"
                  placeholder="Enter city or region"
                />
              </div>

              {/* Organization Type */}
              <div>
                <label className="block text-sm font-medium text-gray-700 mb-2">
                  Organization Type
                </label>
                <select
                  name="orgType"
                  value={searchParams.orgType}
                  onChange={handleChange}
                  className="w-full px-4 py-3 rounded-xl border border-gray-200 focus:ring-2 focus:ring-teal-500 focus:border-transparent transition duration-200"
                >
                  <option value="">Select type</option>
                  <option value="nonprofit">Nonprofit</option>
                  <option value="forprofit">For-Profit</option>
                  <option value="social">Social Enterprise</option>
                  <option value="government">Government</option>
                </select>
              </div>
            </div>

            {/* Partnership Goal */}
            <div>
              <label className="block text-sm font-medium text-gray-700 mb-2">
                What Kind of Organization Are You Looking For?
              </label>
              <textarea
                name="partnershipGoal"
                value={searchParams.partnershipGoal}
                onChange={handleChange}
                rows="3"
                className="w-full px-4 py-3 rounded-xl border border-gray-200 focus:ring-2 focus:ring-teal-500 focus:border-transparent transition duration-200"
                placeholder="Describe your ideal partnership..."
              />
            </div>

            {/* Search Button */}
            <div className="flex justify-center">
              <button
                type="submit"
                className="px-8 py-3 bg-teal-500 text-white rounded-full hover:bg-teal-600 transition duration-200 shadow-lg hover:shadow-xl"
              >
                Find Partners
              </button>
            </div>
          </form>
        </div>
      </div>
    </div>
  );
};

export default PartnershipSearch;
